import React from "react";
import {Link} from "react-router-dom";
import { ProjectDiv } from "./project-item.styles";

export const ProjectItem = ({projectName, projectStatus, id}) => {
    return (
        <ProjectDiv key={id}>
              <Link to={`/project/${id}`}> <h3>{projectName} ({projectStatus})</h3> </Link>
        </ProjectDiv>
    )
}
